import React, { useState } from "react";
import 'antd/dist/antd.css';
import { Switch} from 'antd';
import {
  Navbar,
  Nav,
  Form,
  FormControl,
  Button,
  NavDropdown,
} from "react-bootstrap";
import logo from "../images/icon.png";
import classes from "./Navbar.module.css";
import { DragSwitch } from "react-dragswitch";

const Navba = (props) => {
  const [checked, setChecked] = useState(false);
  function onChange(checked){
    if (checked){
      props.ColorChanger()
    }
  }
  return (
    
 <Navbar collapseOnSelect expand="lg" bg="dark" variant="dark">
<Navbar.Brand className={classes.icon} href="#home">
  <img
    alt=""
    src={logo}
    width="30"
    height="30"
    className="d-inline-block align-top"
  />{" "}
  CoinStats
</Navbar.Brand>
<Nav  className="mr-auto">
<button style={{borderRadius:'round'}} onClick={props.ColorChanger}>change</button>
    
<Nav.Link  href="#home">Portfolio Tracker</Nav.Link>
<Nav.Link  href="#features">Live Prices</Nav.Link>
<Nav.Link  href="#pricing">Pricing</Nav.Link>
<Nav.Link  href="#pricing">Alerts</Nav.Link>
</Nav>
<NavDropdown className={classes.navtextcolor} title="USD" id="collasible-nav-dropdown">
<NavDropdown.Item  href="#action/3.1">Action</NavDropdown.Item>
<NavDropdown.Item href="#action/3.2">Another action</NavDropdown.Item>
<NavDropdown.Item href="#action/3.3">Something</NavDropdown.Item>
<NavDropdown.Divider />
<NavDropdown.Item href="#action/3.4">Separated link</NavDropdown.Item>
</NavDropdown>
<NavDropdown title="Language" id="collasible-nav-dropdown">
<NavDropdown.Item href="#action/3.1">Action</NavDropdown.Item>
<NavDropdown.Item href="#action/3.2">Another action</NavDropdown.Item>
<NavDropdown.Item href="#action/3.3">Something</NavDropdown.Item>
<NavDropdown.Divider />
<NavDropdown.Item href="#action/3.4">Separated link</NavDropdown.Item>
</NavDropdown>
<Form inline>
<FormControl type="text" placeholder="Search" className="mr-sm-2"/>
<Button variant="outline-info">Search</Button>
</Form>
<Nav>
<Nav.Link href="#features">Login</Nav.Link>
<Nav.Link href="#pricing">Get Started</Nav.Link>  
</Nav>
</Navbar> 


  );
};

export default Navba;






